import React, { useContext } from "react";

import { NavLink } from "react-router-dom";
import { AuthContext } from "../../shared/context/auth.context";

import "../../../styles/header.scss";

export const NavLinkItem: React.FC = () => {
  const auth = useContext(AuthContext);
  const { isLoggedIn } = auth;
   const linksItems = [
    { to: "/", label: "All Users", exact: true },
    { to: "/places/new", label: "Add Place", exact: false, auth: true },
    { to:"/places",label:"My Places",exact:false,auth:true},
    { to: "/auth", label: "Login", exact: false, auth: false },
    { to: "/auth", label: "Logout", exact: false, auth: true },
   ]
  return (
    <ul className="nav-links">
      {
        React.Children.toArray(
          linksItems.map((item) => {})
        )
      }
      <li>
        <NavLink className={(navData) => (navData.isActive ? "active" : "")} to="/">
          ALL USERS
        </NavLink>
      </li>
   {isLoggedIn&&<li>
        <NavLink className={(navData) => (navData.isActive ? "active" : "")} to="/u1/places">
          my places
        </NavLink>
      </li>}
   {isLoggedIn&&<li>
        <NavLink className={(navData) => (navData.isActive ? "active" : "")} to="/places/new">
          add place
        </NavLink>
      </li>}
      <li>
        <NavLink className={(navData) => (navData.isActive ? "active" : "")} to="/auth">
          {" "}
          Authentication
        </NavLink>
      </li>
    </ul>
  );
};
